import React from "react";
import { NavLink } from "react-router-dom";

const MainNavigation = () => {
  return (
    <ul>
      <li>
        <NavLink
          to="/"
          className={({ isActive }) => (isActive ? "active" : "undefined")}
        >
          Home
        </NavLink>
      </li>
      <li>
        <NavLink
          to="/"
          className={({ isActive }) => (isActive ? "active" : "undefined")}
        >
          About
        </NavLink>
      </li>
      <li>
        <NavLink
          to="/"
          className={({ isActive }) => (isActive ? "active" : "undefined")}
        >
          Products
        </NavLink>
      </li>
    </ul>
  );
};

export default MainNavigation;
